import React from "react";
import SingleInputContainer from './SingleInputContainer';
import Warning from "./warning";


function Doctor(props){
  const {values,errors,handler,handleSubmit} = Warning();
    const addDoctorInputValue=[
        {
          'name':'fName',
          'type':'text',
          'error': "",
          'label':'First Name',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'lName',
          'type':'text',
          'error':"",
          'label':'Last Name',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'cellPhone1',
          'type':'tel',
          'error':"",
          'label':'Cell Phone 1',
          'required':true,
          'validationType':"phone",
          'value':""
        },{
          'name':'cellPhone2',
          'type':'tel',
          'error':"",
          'label':'Cell Phone 2(optional)',
          'required':false,
          'validationType':"phone",
          'value':""
        },{
          'name':'city',
          'type':'text',
          'error':"",
          'label':'City',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'subcity',
          'type':'text',
          'error':"",
          'label':'Sub City',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'woreda',
          'type':'number',
          'error':"",
          'label':'Woreda',
          'required':true,
          'validationType':"number",
          'value':""
        },{
          'name':'birthPlace',
          'type':'text',
          'error':"",
          'label':'Birth Place',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'dob',
          'type':'Date',
          'error':"",
          'label':'Date Of Birth',
          'required':true,
          'validationType':"date",
          'value':""
        },{
          'name':'email',
          'type':'email',
          'error':"",
          'label':'Email',
          'required':true,
          'validationType':"email",
          'value':""
        },{
          'name':'universityName',
          'type':'text',
          'error':"",
          'label':'University Name',
          'required':true,
          'validationType':"name",
          'value':""
        },{
          'name':'yearOfGraduaion',
          'type':'date',
          'error':"",
          'label':'Year Of Graduaion',
          'required':true,
          'validationType':"year",
          'value':""
        },{
          'name':'CGPA',
          'type':'number',
          'error':"",
          'label':'CGPA',
          'required':true,
          'validationType':"grade",
          'value':""
        },{
          'name':'language',
          'type':'text',
          'error':"",
          'label':'Language',
          'required':true,
          'validationType':"name",
          'value':""
        },
      ];
      function add() {
        alert("added");
      }
      const addDoctorInput=addDoctorInputValue.map((value)=>{
        return(<SingleInputContainer name={value.name} type={value.type} handler={handler}
        label={value.label} error={value.error} required={value.required} validationType={value.validationType}/>);
      })
    return(
        <form  onSubmit={handleSubmit}>
          <div className='formInput'>
          <div className='personal_Information'> 
            <h3 className="title">Personal Information</h3>
            <div className='fullName'>
              {addDoctorInput[0]}{addDoctorInput[1]}
            </div>
            <div className='phoneNumber'>
              {addDoctorInput[2]}{addDoctorInput[3]}
            </div>
            <div className='address'>
              {addDoctorInput[4]}{addDoctorInput[5]}{addDoctorInput[6]}
            </div>
            <div className='birthInfo'>
              {addDoctorInput[7]}{addDoctorInput[8]}
            </div>
              {addDoctorInput[9]}
          </div>
          <hr className='middleHr'/>
          <div className='acadamy_information'>
            <h3 className="title">Acadamy Information</h3>
              {addDoctorInput[10]}{addDoctorInput[11]}{addDoctorInput[12]}{addDoctorInput[13]}
          </div>
          </div>
          <button type="submit">Submit</button>
        </form> 
);
}
export default Doctor;
